#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на инициатора заказа',
  `product_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на товар',
  `order_status_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на статус заказа',
  `payment_method_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на способ оплаты',
  `pick_up_point_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пункт выдачи',
  `price` decimal(19,2) NOT NULL COMMENT 'Цена товара',
  `quantity` int(10) unsigned NOT NULL COMMENT 'Количество товара',
  `total_cost` decimal(19,2) NOT NULL COMMENT 'Общая стоимость товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Заказы';



